import React from 'react';
import { useState } from 'react';

const Pschedule = () => {
    const [array1, setArray1] = useState(["Stiles Stilinski","wensday","1:00","2:00"]);
    const [array2, setArray2] = useState(["Lydia martin","sunday","4:00","5:00"]);
    const [a, setA] = useState([" "]);
    const PatientName="Derek Hale";
    function CLEAR(array)
    {
        if(array==array1)
        {setArray1([ ])}
        else{setArray2([ ])}
      
    }
    function ChangeDocName(array)
    {
        let i=document.getElementById("changeDoc").value;
        let i1=document.getElementById("changeDoc2").value;
        if(array==array1 && i!="")
        {   const newData = [...array1];
            newData[0] = i;
            setArray1(newData);
        }
        else if(array==array2 && i1!="")
        {
            const newData = [...array2];
            newData[0] = i1;
            setArray2(newData);
        }
    }
    function ChangeSlot(array)
    {
        let in1=document.getElementById("changestart").value;
        let in2=document.getElementById("changeend").value;
        let in3=document.getElementById("changestart2").value;
        let in4=document.getElementById("changeend2").value;
        if(array==array1 && in1!="" && in2!="" )
        {   const newData = [...array1];
            newData[2] = in1;
            newData[3] = in2;
            setArray1(newData);
        }
        else if(array==array2 && in3!="" && in4!="")
        {
            const newData = [...array2];
            newData[2] = in3;
            newData[3] = in4;
            setArray2(newData);
        }
    }

    return (
        <div className='assign'>
           <u><p className='home-logout'><a href='/SignInPage'>logout</a></p></u>
           <u><p className='home-logout'><a href='/'>Home</a></p></u>
            <h1 className='header2'>YOUR Reservations</h1>
            <br />
            <br />
           
        <table >
        <thead>
        <tr >
            <th>Patient Name</th>
            <th>Doctor Name</th>
            <th>Day</th>
            <th>start_time</th>
            <th>end_time</th>
        </tr>
        </thead>
        <tbody>
        <tr>
            <td>{PatientName}</td>
            <td>{array1[0]}</td>
            <td>{array1[1]}</td>
            <td>{array1[2]}</td>
            <td>{array1[3]}</td>
            <td>{array1[4]}</td>
            <button onClick={() =>CLEAR(array1)}>Cancel</button>
            <input type='text' id='changeDoc' placeholder='Enter name'/>
            <button onClick={() =>ChangeDocName(array1)}>Change doctor</button>
            <input type='text' id='changestart' placeholder='Enter srart-time'/>
            <input type='text' id='changeend' placeholder='Enter end-time'/>
            <button onClick={() =>ChangeSlot(array1)}>Change slot</button>
        </tr>
        <tr>
            <td>{PatientName}</td>
            <td>{array2[0]}</td>
            <td>{array2[1]}</td>
            <td>{array2[2]}</td>
            <td>{array2[3]}</td>
            <td>{array2[4]}</td>
            <button onClick={() =>CLEAR(array2)}>Cancel</button>
            <input type='text' id='changeDoc2' placeholder='Enter name'/>
            <button onClick={() =>ChangeDocName(array2)}>Change doctor</button>
            <input type='text' id='changestart2' placeholder='Enter srart-time'/>
            <input type='text' id='changeend2' placeholder='Enter end-time'/>
            <button onClick={() =>ChangeSlot(array2)}>Change slot</button>
        </tr>
    
        </tbody>
    </table>
    <br/>
    <br/>
    <br/>
    <button ><a href='/'>Back</a></button>
    </div>
        );
      
};
    
export default Pschedule;
